Il cardamomo è un rimedio naturale per le infiammazioni gengivali e del tratto urinario, per tosse e raffreddore, per problemi di digestione, emorroidi e intestino irritabile.
Sembra inoltre essere un efficace antidoto contro il veleno di serpenti e scorpioni.
 Tra le proprietà del cardamomo c’è poi quella di essere una spezia bruciagrassi: i semi di queste bacche infatti avrebbero proprietà snellenti in quanto andrebbero ad accelerare il metabolismo del corpo.
Visto il suo ottimo aroma, il cardamomo è una spezia usata per contrastare  l’alitosi e rinfrescare la bocca mantenendo pulito tutto il cavo orale.
Controindicazioni
